import React from 'react';

const UserForm = () => {
    return (
        <div>
            <form action="">
                <div className='d-flex justiy-content-around mb-4'>
                    <label htmlFor="userEmail"><h5>email</h5></label>
                    <input type="email" id='userEmail' placeholder='Enter Your Email'/>
                </div>
                <div className='d-flex justiy-content-around' mb>
                    <label htmlFor="Role"><h5>email</h5></label>
                    <select name="role" id="role">
                        <option value="admin">Admin</option>
                        <option value="oparetors">Oparetors</option>
                        <option value="viewers">Viewers</option>
                    </select>
                </div>
            </form>
        </div>
    );
};

export default UserForm;
